function Blog_profil() {
    return (
      <>
        <div className="mypost">
          <img src="/img/logo.jpg" alt="Post Image 1" />
        </div>
        <div className="mypost">
          <img src="/img/logo2.jpg" alt="Post Image 2" />
        </div>
        <div className="mypost">
          <img src="/img/111.jpg" alt="Post Image 3" />
        </div>
      </>
    );
  }
  
  export default Blog_profil;
